import React from "react";
import { Spinner } from "reactstrap";
import "./spinner.css";
const Spinnerr = (props) => {
  return (
    <div className="loading">
      <Spinner color="primary" />
      {props.message}
    </div>
  );
};

export default Spinnerr;
